function () {
      cy.step('Assert name, required, and allow multiple selection fields are default');
      miniSettings.getNode().within(function () {
        cy.get(fields.name).should('have.value', 'Field 3');
        cy.get(fields.required).find('svg').should('have.attr', 'style').and('match', /display: none/);
        cy.get(fields.allowMultiple).find('svg').should('have.attr', 'style').and('match', /display: none/);
      });
      cy.step('Assert id and name attributes on canvas element are default');
      canvas.within(function () {
        cy.get(select).should('have.attr', 'id', 'field-3').and('have.attr', 'name', 'field-3');
      });
      cy.step('Assert select has 4 options on the canvas');
      canvas.within(function () {
        var options = [{
          text: 'Select one...',
          value: ''
        }, {
          text: 'First Choice',
          value: 'First'
        }, {
          text: 'Second Choice',
          value: 'Second'
        }, {
          text: 'Third Choice',
          value: 'Third'
        }];
        cy.get(select).find('option').should('have.length', 4);
        cy.get("".concat(select, " option")).each(function ($el, index) {
          cy.wrap($el).should('have.value', options[index].value).and('have.text', options[index].text);
        });
      });
    }

function () {
      cy.step('Change name to "New Name"');
      miniSettings.getNode().within(function () {
        cy.get(fields.name).clear().type('New Name').blur();
      });
