function () {
    cy.step('Add Image element to the canvas');
    workspace.getLeftSidebar().clickAddElementButton().clickBuiltinTab().clickOption('Image');
    workspace.getRightPanel().getStylesTab().selector.setClassNames(['qa-image']);
    cy.step('Assert that the mini-settings are open');
    miniSettings.getNode().should('be.visible');
    cy.step('Assert oncanvas image has loading=lazy attribute');
    canvas.within(function () {
      cy.get('.qa-image').should('have.attr', 'loading', 'lazy');
    });
  }

function () {
    cy.step('Click Choose Image button in mini-settings');
    miniSettings.getNode().within(function () {
      cy.get('.image-settings [aria-label="Choose asset button"]').click();
    });
    cy.step('Assert Asset Manager is visible');
    cy.get('#assets-tab').should('be.visible');
    cy.step('Select first image in Asset Manager');
    cy.get('#assets-tab .bem-LazyGrid').find('.bem-AssetGrid_Item').eq(0).click();
    cy.step('Assert Asset Manager is no longer visible');
    cy.get('#assets-tab').should('not.exist');
    cy.step('Assert mini-settings have new image data');
    miniSettings.getNode().within(function () {
      cy.get('.dimensions').then(function (dimensions) {
        cy.wrap(dimensions).get('.width').should('contain', '700');
        cy.wrap(dimensions).get('.height').should('contain', '700');
      });
    });
    miniSettings.getNode().within(function () {
      cy.get('.size').should('contain', '2.2');
    });
    cy.step('Assert oncanvas image source is correct');
    canvas.within(function () {
      cy.get('.qa-image').should('have.attr', 'src').and('match', /700x700/);
    });
  }

